import React, { useState } from "react";
import { emojis, commands } from "../../data/data";
import Chart from "../charts/chart";
import Table from "./table";
import Server from "./server/server";

import Navbar from "./navbar";
const Dashboard = () => {
  const [main, setMain] = useState("server");
  return (
    <div
      className="container-fluid pb-3"
      style={{ maxWidth: "1300px", minHeight: "100%" }}
    >
      <Navbar setMain={setMain}></Navbar>
      {main === "server" ? (
        <Server></Server>
      ) : main === "users" ? (
        // <Users></Users>
        <div></div>
      ) : (
        <div></div>
        // <Stats></Stats>
      )}
      <div className="row no-gutters">
        <div
          className="col-12 col-md-6 py-3 pl-2 pr-md-3 pr-2"
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 shn">
            <Chart
              data={{
                title: "Top Emojis",
                units: "times",
                items: emojis,
              }}
            ></Chart>
          </div>
        </div>
        <div
          className="col-12 col-md-6 py-3 pl-md-3 pl-2 pr-2"
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 shn">
            <Chart
              data={{
                title: "Top Commands",
                units: "times",
                items: commands.slice(0, 4),
              }}
            ></Chart>
          </div>
        </div>
      </div>
      <div className="row no-gutters">
        <div className="col p-2" style={{ height: "400px", width: "600px" }}>
          <Table></Table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
